import React from 'react';
import logo from 'src\img\foodnetwork.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to FoodNetwork
        </p>
        <ul>
        <li>This is the dream app</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
